script: |
  super -f text -I q10354.spq | sort > q10354.out

inputs:
  - name: q10354.spq
    data: |
      SELECT ALL - col2 / - + col1 AS col0, col1 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT NULL <= + col0 + - 13 + col2 + - CAST ( - + col2 AS INTEGER ) * col1;
  - name: tab2

outputs:
  - name: q10354.out
    data: |
